import React from 'react'
import AllExpenseDetails from './RecentActivityDetils'

function AllExpense(props){
    const expensesOwe = props.expenses.map(item=>{
        return <RecentActivityDetails description={item.description} moneyState="You get back" amount={item.amount} time={item.time}/>
    })
    const expensesYouOwe = props.expensesYouOwe.map(item=>{
        return <RecentActivityDetails description={item.description} moneyState="You owe" amount={item.amount} time={item.time}/>
    })
    return(
        <div className="recent-activity-overflow">
            {expensesOwe}
            {expensesYouOwe}
        </div>
    )
}

export default AllExpense
